INSERT INTO `v1_0e73c6548040b134fd6a8d53f7a16ce7e640a5d392715fb7ea86b55d96bf87d2` VALUES (100, "おいしすぎて食べ始めたら\n止まらない最高のプリンなの\n今のミヤコを止められるヤツは\n誰もいないの", 5, "プリンセスなプリンなの\nお店にあったいろんな食べもの\nを入れられるだけ入れてみたの\nどんな味なのか楽しみなの", 1, 1, 3, "やばいですね☆なの！", "ペコリーヌのプリン");
INSERT INTO `v1_0e73c6548040b134fd6a8d53f7a16ce7e640a5d392715fb7ea86b55d96bf87d2` VALUES (101, "なんだかすごくやさしい気持ち\nになる味なの…\nおはようからおやすみまで\nずっと一緒な味なの…", 5, "いつもオマエのそばに寄りそう\nヤツのぷりんなの。ミヤコの\nワガママもやさしく受け入れて\nくれそうなの", 2, 1, 3, "主さま、なの！", "コッコロのプリン");
INSERT INTO `v1_0e73c6548040b134fd6a8d53f7a16ce7e640a5d392715fb7ea86b55d96bf87d2` VALUES (102, "いろんな味が一度で楽しめる\nプリンなの。ツンデレはプリン\nにするとおいしいの。ミヤコも\nツンデレを目指してみるの", 5, "ツンツンデレデレなヤツの\nプリンなの。砂糖とスパイスを\n混ぜてみたの。どんな味になる\nか楽しみなの", 3, 0, 3, "ぶっ殺すぞ！なの！\n…デレデレはどこなの？", "キャルのプリン");
INSERT INTO `v1_0e73c6548040b134fd6a8d53f7a16ce7e640a5d392715fb7ea86b55d96bf87d2` VALUES (103, "あったかいところで食べる\nプリンアイスは最高なの～♪\n安心しすぎて昔の記憶のない\nミヤコも心が子どもになるの～", 5, "オマエと同じで、一度赤ちゃん\nみたいになったヤツのプリン\nなの。ヒンヤリ、プリンアイス\nにしてみたの", 4, 1, 3, "おにーたん♪なの！", "シェフィのプリン");
INSERT INTO `v1_0e73c6548040b134fd6a8d53f7a16ce7e640a5d392715fb7ea86b55d96bf87d2` VALUES (104, "トマトで栄養補給も完璧なの\nどんどん力がみなぎってきて\n復活も夢じゃないの\nミヤコが復活したら…", 5, "イリヤを見てたら思いついた\nトマトジュースが隠し味の\nプリンなの。栄養満点なの", 5, 1, 3, "ハーハッハッハ！\n世界征服なのじゃなのー！", "イリヤのプリン");
INSERT INTO `v1_0e73c6548040b134fd6a8d53f7a16ce7e640a5d392715fb7ea86b55d96bf87d2` VALUES (105, "見た目がかわいくてもミヤコは\n味にも厳しいの。あむっ…\nこ、これは…！なんだかすごく\n変な気分になってきたの…", 5, "アカリのプリンなの。ヨリと\n同じくらいかわいく作って\nやったの。正直ミヤコは\nおいしければなんでもいいの", 6, 1, 3, "お兄ちゃんのエッチ！　なの！", "アカリのプリン");
INSERT INTO `v1_0e73c6548040b134fd6a8d53f7a16ce7e640a5d392715fb7ea86b55d96bf87d2` VALUES (106, "んむぅ…これはなかなか感想が\n難しいプリンなの…率直に言い\nたいような…心のうちに秘めて\nおきたいような…", 5, "かわいくつくらないとアカリが\n怒りそうだからヨリのプリンは\nかわいく作ったの。自信作なの", 7, 1, 3, "えっと…その…あんたのこと…\nだ、大っ嫌いなのーー！", "ヨリのプリン");
INSERT INTO `v1_0e73c6548040b134fd6a8d53f7a16ce7e640a5d392715fb7ea86b55d96bf87d2` VALUES (107, "このプリンを食べるとシノブが\nミヤコの中にいるみたいなの！\nシノブの力があれば未来の\nプリンを見放題なの！", 5, "シノブはいつもミヤコに\nやさしくしてくれるから\n丁寧に作ったの。ドクロ親父は\nいらないから作ってないの", 8, 0, 3, "お父さん…\nいいかげんにしてなの！\nん？プリンの未来は…\n見えなかったの…", "シノブのプリン");
INSERT INTO `v1_0e73c6548040b134fd6a8d53f7a16ce7e640a5d392715fb7ea86b55d96bf87d2` VALUES (108, "固すぎてかじれないから丸吞み\nにしたの。なんだか体が硬く\nなった気がするの。みんなを\n守れる気がするの！", 5, "黒い鎧を脱がないヤツのプリン\nなの。固めのプリンを目指したら\nカチカチになりすぎたの", 9, 1, 3, "インフェルノシールド！なの！", "ジュンのプリン");
INSERT INTO `v1_0e73c6548040b134fd6a8d53f7a16ce7e640a5d392715fb7ea86b55d96bf87d2` VALUES (109, "口の中でスパイスがプチプチ\nはじけて新食感なの！\nプチプチがミヤコを\n翻弄するの！", 5, "オマエをいっつもからかってる\nヤツのプリンなの\nちょっぴり変わったスパイスで\nからかいを表現したの", 10, 1, 3, "あなたといると調子が狂うな\n…なの\n翻弄してたのはオマエなの？", "トモのプリン");
INSERT INTO `v1_0e73c6548040b134fd6a8d53f7a16ce7e640a5d392715fb7ea86b55d96bf87d2` VALUES (110, "ん～見かけによらず濃厚な\nパンチのある味わいが\n口いっぱいに広がるの！", 5, "王宮騎士団にいるちっこいヤツ\nなの。ちっこいけどやるヤツ\nらしいから、濃いめの味付けに\nしてみたの", 11, 1, 3, "タイガーヒーローボンバー！\nなの！", "マツリのプリン");
INSERT INTO `v1_0e73c6548040b134fd6a8d53f7a16ce7e640a5d392715fb7ea86b55d96bf87d2` VALUES (111, "クールな見た目なのにとっても\n優しい味なの！なんだか\n懐かしさを感じるの…", 5, "なんかすごくクールなプリンなの\nなんかテンションも少し\n低そうなの。これ\n食べちゃっても大丈夫なの？", 13, 1, 3, "ま、いいんじゃん？\nしらんけどなの", "クロエのプリン");
INSERT INTO `v1_0e73c6548040b134fd6a8d53f7a16ce7e640a5d392715fb7ea86b55d96bf87d2` VALUES (112, "なんか変わった食感なの…\nちゃる…ちょる…ちぇる？\nちぇるってしてるの\nでもちぇるってなんなの？", 5, "きれいにデコれたの！\nカラフルでおいしそうなの\nこれは期待できそうなの", 14, 1, 3, "ぷりーん★なの！", "チエルのプリン");
INSERT INTO `v1_0e73c6548040b134fd6a8d53f7a16ce7e640a5d392715fb7ea86b55d96bf87d2` VALUES (113, "味はなんか妙に\n甘酸っぱいの…\n食べたことない味なの\nこの味ってもしかして…", 5, "見た目は完ぺきなの！\nこれをつくったやつは\nきっと天才なの！\n早く食べたいの！", 15, 1, 3, "端的に換言すれば\n青春の味なの？", "ユニのプリン");
INSERT INTO `v1_0e73c6548040b134fd6a8d53f7a16ce7e640a5d392715fb7ea86b55d96bf87d2` VALUES (114, "ミヤコも幽霊になる前の記憶\nがないのに、なんだか懐かしい\n気持ちになってくるの…", 5, "オマエから聞いた懐かしい\n味ってヤツを全部入れてみたの\nオマエ記憶がないのに懐かしい\nってどういうことなの？", 16, 1, 3, "幼なじみはあんた…なの？", "サレンのプリン");
INSERT INTO `v1_0e73c6548040b134fd6a8d53f7a16ce7e640a5d392715fb7ea86b55d96bf87d2` VALUES (115, "おかしいの。このプリンを\n食べてから、３回も転んだの\nミヤコは幽霊だから転んだり\nしないの。なんでなの…？", 5, "たまたま会ったメイドに教えて\nもらった作り方なの。メイドは\nプリンも作れるはずなの。\nなのにこの不安は何なの…？", 17, 1, 3, "ひゃああんなの～！", "スズメのプリン");
INSERT INTO `v1_0e73c6548040b134fd6a8d53f7a16ce7e640a5d392715fb7ea86b55d96bf87d2` VALUES (116, "甘さのなかに少しのしょっぱさ\nクセになる味なの\nこのプリンはがんばればきっと\nいろんな美味しいになれるの", 5, "怖がりな子どもが教えてくれた\n小さくてかわいいプリンなの　\n触ってないのにぷるぷる震える\n驚きのやわらかさなの", 18, 0, 3, "サルキデバレヤ！なの！", "クルミのプリン");
INSERT INTO `v1_0e73c6548040b134fd6a8d53f7a16ce7e640a5d392715fb7ea86b55d96bf87d2` VALUES (117, "このプリン、食べるとなんだか\nお姉ちゃんになった気分に\nなるの。ピンチのプリンは\nミヤコが守ってやるの！", 5, "くまのぬいぐるみを見ていたら\nひらめいたの。小さいけど\nしっかりした甘さの元気に\nなれるプリンなの！", 19, 1, 3, "プリンフルスイングなの～！", "アヤネのプリン");
INSERT INTO `v1_0e73c6548040b134fd6a8d53f7a16ce7e640a5d392715fb7ea86b55d96bf87d2` VALUES (118, "メルヘンパワーがあふれてきて\nいまならミヤコにも魔法が\n使える気がするの！\nほな、いきまひょ～なの！", 5, "マホマホ王国って国にいる\nお姫様のプリンなの\n魔物も虜にしちゃう\nすてきなプリンなの", 20, 1, 3, "みらくるみやりん\nくるりんぱ～☆なの！", "マホのプリン");
INSERT INTO `v1_0e73c6548040b134fd6a8d53f7a16ce7e640a5d392715fb7ea86b55d96bf87d2` VALUES (119, "うおーん！ミヤコなんだか\n強くなった気がするの！\n困ったことがあればミヤコが\nまとめて面倒見てやるの！", 5, "カッコいいプリンを目指して\nワイルドなものをガンガン\n入れてみたの。きっと熱い\nプリンができるはずなの", 21, 1, 3, "ウルフェンバイトなの！", "マコトのプリン");
INSERT INTO `v1_0e73c6548040b134fd6a8d53f7a16ce7e640a5d392715fb7ea86b55d96bf87d2` VALUES (120, "一口食べたら元気が\nあふれて止まらないの！\n気分がいいから、一曲\n踊りでも披露してやるの！", 5, "どっかの国でよくとれる\nゴーヤーに似てるやつを\nいれてみたの！ちょっと\n苦いらしいけど…", 22, 1, 3, "なんくるないさ～！なの！", "カオリのプリン");
INSERT INTO `v1_0e73c6548040b134fd6a8d53f7a16ce7e640a5d392715fb7ea86b55d96bf87d2` VALUES (121, "むむむ…なるほどなの\n上質な糖分をふんだんに\n使うことで、脳をより活性化\nできるからなの！", 5, "勘の鋭いやつが好きな食べ物を\nたくさん入れてみたの\n難しいこと考えるのにぴったり\nらしいけど、なんでなの？", 23, 1, 3, "ふふん。簡単な推理なの", "カスミのプリン");
INSERT INTO `v1_0e73c6548040b134fd6a8d53f7a16ce7e640a5d392715fb7ea86b55d96bf87d2` VALUES (122, "ミルクがとっても濃厚で\nほっぺたが落ちちゃうの～♪\nこのプリンからは牧場の…\n自然の息吹を感じるの！", 5, "搾りたての牛乳を\nたっぷり使ったプリンなの～\nマヒルに手伝ってもらって\nミヤコ直々に搾ってきたの！", 24, 1, 3, "エリザベス～！なの～！", "マヒルのプリン");
INSERT INTO `v1_0e73c6548040b134fd6a8d53f7a16ce7e640a5d392715fb7ea86b55d96bf87d2` VALUES (123, "ほのかな甘さでありながら\nしっかりとした主張も\n感じさせる\n味わい深いプリンなの", 5, "マヒルからやさしいヤツだって\n聞いたの。やさしさを表現\nするために奥ゆかしい甘さに\n仕上げてみたの", 25, 1, 3, "私の好きな本…読んで\nもらえたらうれしいです…\nなの", "シオリのプリン");
INSERT INTO `v1_0e73c6548040b134fd6a8d53f7a16ce7e640a5d392715fb7ea86b55d96bf87d2` VALUES (124, "こ、これは…！口の中に入れた\n瞬間にふんわり溶けて\nなくなっちゃうの！\nその食感がやみつきなの！", 5, "牧場にいるヤツらしいの\n牛とは違うらしいの\nもふもふ気持ちいいらしいから\n食感にこだわって作ったの", 26, 1, 3, "もふもふにしてあげるなの！", "リマのプリン");
INSERT INTO `v1_0e73c6548040b134fd6a8d53f7a16ce7e640a5d392715fb7ea86b55d96bf87d2` VALUES (125, "んむぅ…評価が難しい味なの…\nおいしいのはおいしいの…\nん～考えてたら…\n眠くなってきたの…", 5, "いっつも寝てるやつらしいの\nぐっすり眠れる薬草をたくさん\n入れてみたの。プリンとして\nおいしくなるかはわからないの", 27, 0, 3, "めんどくさいな～なの…", "リンのプリン");
INSERT INTO `v1_0e73c6548040b134fd6a8d53f7a16ce7e640a5d392715fb7ea86b55d96bf87d2` VALUES (126, "プ…プリンなのにクレープの味\nがするの。味もすごく普通なの\nでも…なんだかプリンの新しい\n扉を開けそうな気がするの…！", 5, "クレープ屋の真っ赤な人に\n教わったプリンなの\n作り方を丁寧に教えてくれて\nとっても優しい人だったの！", 28, 1, 3, "プリンの権能を解放するの～！", "ラビリスタのプリン");
INSERT INTO `v1_0e73c6548040b134fd6a8d53f7a16ce7e640a5d392715fb7ea86b55d96bf87d2` VALUES (127, "とろける食感が絶品なの～♪\n食べるとなんだか幸せな\n気持ちになれるの…これが\n愛情ってやつなの？", 5, "お店に落ちてた謎のレシピの\nプリンなの。レシピの表紙には\n『お姉ちゃんの愛情たっぷり』\nって書いてあったの", 29, 0, 3, "お姉ちゃんパワー全開！なの！", "シズルのプリン");
INSERT INTO `v1_0e73c6548040b134fd6a8d53f7a16ce7e640a5d392715fb7ea86b55d96bf87d2` VALUES (128, "これで妹力？があがるらしいの。\n妹になればお兄ちゃんに\nプリンをたかり放題なの！\n最高なの～！", 5, "リノから作り方を教わったの！\nさすがクレープ屋で働いてる\nだけあって美味しそうなの！", 30, 1, 3, "お兄ちゃん、プリンをよこすの！", "リノのプリン");
INSERT INTO `v1_0e73c6548040b134fd6a8d53f7a16ce7e640a5d392715fb7ea86b55d96bf87d2` VALUES (129, "食べたら元気が湧いてくるの\nだからプリンのレシピのお礼に\nミヤコも人助けを手伝って\nやったの。ミヤコはえらいの！", 5, "プリンのレシピで悩んでたら\n通りすがりのおねーさんが\n一緒に考えてくれたプリンなの\nいいヤツもたまにはいるの～♪", 31, 1, 3, "困った時はお互いさまさま！\nなの！", "ヒヨリのプリン");
INSERT INTO `v1_0e73c6548040b134fd6a8d53f7a16ce7e640a5d392715fb7ea86b55d96bf87d2` VALUES (130, "はっ…思わずお花畑が見えたの\n身も心も包まれるような\nとっても優しい味がするの\nこれは…まさに癒しなの～♪", 5, "ミヤコががんばって作った\nこだわりのプリンなの～\nプリンは癒しなの。だから優しい\n気持ちで丁寧に作ったの", 32, 1, 3, "フラワリングヒールなの～♪", "ユイのプリン");
INSERT INTO `v1_0e73c6548040b134fd6a8d53f7a16ce7e640a5d392715fb7ea86b55d96bf87d2` VALUES (131, "確かに完璧なプリンなの\nでも究極のプリンと呼ぶには\nまだまだ修行が必要なの…\nプリン作りは奥が深いの…！", 5, "究極のプリンを作るため\nミヤコは厳しい修行をしたの…\nその結果あって完成した\nクールで完璧なプリンなの！", 33, 1, 3, "スラッシュテンペスト！なの。", "レイのプリン");
INSERT INTO `v1_0e73c6548040b134fd6a8d53f7a16ce7e640a5d392715fb7ea86b55d96bf87d2` VALUES (132, "味にも素材にもこだわりが\nあるの。一流は妥協しないの\nもっと豪華に、もっとおいしく\nできるはず…", 5, "豪華で高級な\nお嬢様プリンなの\n中には宝石みたいな\n大きいイチゴを入れるの！", 34, 1, 3, "おーほっほほほ！なの！", "アキノのプリン");
INSERT INTO `v1_0e73c6548040b134fd6a8d53f7a16ce7e640a5d392715fb7ea86b55d96bf87d2` VALUES (133, "プリンは飲み物とも言うの\nぐいっていってみるの\n…ふわしゅわでとろけるの～！\n体に染みわたるの～", 5, "外はしっかり、中はふわとろの\nプリンにするの\n泡みたいなしゅわしゅわの\n生クリームも入れるの♪", 35, 1, 3, "プリしゅわ最高～！なの！", "ユカリのプリン");
INSERT INTO `v1_0e73c6548040b134fd6a8d53f7a16ce7e640a5d392715fb7ea86b55d96bf87d2` VALUES (134, "このプリンは焼きたてのうちに\n食べるのが一番なの…！\n熱いけどおいしくて\nうずうずしてきたの…！", 5, "餡子を入れて\nオーブンでこんがり焼くの\nたい…焼きプリンなの\n斬新なの！", 36, 1, 3, "にゃにゃにゃ！なの！", "タマキのプリン");
INSERT INTO `v1_0e73c6548040b134fd6a8d53f7a16ce7e640a5d392715fb7ea86b55d96bf87d2` VALUES (135, "プリンはいつでも手軽に\n食べられるのも魅力なの\nこれは食べ応えもあるから一つ\n食べればいっぱい動けるの", 5, "栄養バランスを考えて\n木の実をたくさん入れるの\nあれこれ忙しいときでも\n頼りになるプリンなの！", 37, 0, 3, "効率全開！なの！", "ミフユのプリン");
INSERT INTO `v1_0e73c6548040b134fd6a8d53f7a16ce7e640a5d392715fb7ea86b55d96bf87d2` VALUES (136, "このプリンを食べてから\nいい子になった気がするの\n大好きなプリンを泣いてる子に\nあげたの。いい気分なの", 5, "エルフの森で子どもにもらった\n薬草を使って作ったの\nこんな優しい味のプリンは\n初めてなの…", 38, 1, 3, "あらあら～なの～♪", "ミサトのプリン");
INSERT INTO `v1_0e73c6548040b134fd6a8d53f7a16ce7e640a5d392715fb7ea86b55d96bf87d2` VALUES (137, "あまいプリンが口の中で\nぽんぽん弾ける未知の味なの！\n今なら不思議な力で世界も\n救えそうなの！でも眠くなるの…", 5, "お昼寝でみた夢の中に\nでてきた不思議なプリンを\n作ってみたの。見てたらまた\n眠くなってきたの…", 39, 1, 3, "スヤスヤ～…なの…", "ハツネのプリン");
INSERT INTO `v1_0e73c6548040b134fd6a8d53f7a16ce7e640a5d392715fb7ea86b55d96bf87d2` VALUES (138, "知らないうちにはしっこに\n隠れちゃってたの。食べたら\nミヤコ、シノブたちに会いに\nいきたくなってきたの", 5, "お店のはしっこに一つだけ\n残ったおもちゃを見て思い\nついたの。他のプリンと一緒に\n置いておくと震えだすの", 40, 1, 3, "ぼっちは卒業なの～！", "アオイのプリン");
INSERT INTO `v1_0e73c6548040b134fd6a8d53f7a16ce7e640a5d392715fb7ea86b55d96bf87d2` VALUES (139, "口の中に華やかな甘さが\n広がる…これがアイドルなの？\n急に歌って踊りたく\nなってきたの！", 5, "トップオブアイドルの\nプリンなの。キラキラした\nものを入れて、あつ～い\nオーブンで焼いてみたの", 41, 1, 3, "リズムあげるのー！", "ノゾミのプリン");
INSERT INTO `v1_0e73c6548040b134fd6a8d53f7a16ce7e640a5d392715fb7ea86b55d96bf87d2` VALUES (140, "プリンの生地がとっても\nなめらかで最高の舌触りなの！\n精霊、ミヤコのプリンのために…", 5, "ミヤコにプリンをくれるすごく\nいいヤツのプリンなの\n精霊に呼びかけながら\n一生懸命かき混ぜたの", 42, 1, 3, "風の加護を！なの！", "チカのプリン");
INSERT INTO `v1_0e73c6548040b134fd6a8d53f7a16ce7e640a5d392715fb7ea86b55d96bf87d2` VALUES (141, "包装は食べるまでの手間が\n増えてめんどくさいの。でも\nそのめんどくささもプリンの\n味を引き立てるの", 5, "歌って踊って衣装も作れるヤツ\nのプリンなの。このプリンは\nきれいに包装するの。プリンを\n最高の形で着飾らせるの", 43, 1, 3, "騎士さんのために\nしたんじゃありません！なの！", "ツムギのプリン");
INSERT INTO `v1_0e73c6548040b134fd6a8d53f7a16ce7e640a5d392715fb7ea86b55d96bf87d2` VALUES (142, "んむっ！？\nく、口のなかでプリンの\nおいしさが大暴れなの！\n止まらないの！", 5, "プリンをくれないならどうでも\nいいヤツなの。でも横で\nいろいろ言ってきたから\nがんばって作ったの", 12, 0, 3, "宴の始まりなの！", "クリスティーナのプリン");
INSERT INTO `v1_0e73c6548040b134fd6a8d53f7a16ce7e640a5d392715fb7ea86b55d96bf87d2` VALUES (143, "大人の味なの。今やミヤコは\nみんなの頼れる姐御なの！\n悪さするやつはミヤコが\n許さないの！", 5, "大人な甘さ控えめのプリンを\n作るの。試しにお魚を入れて\nみるの。プリンの可能性は\n無限大なの！", 44, 1, 3, "一刀両断、覚悟しな！なの！", "ルカのプリン");
INSERT INTO `v1_0e73c6548040b134fd6a8d53f7a16ce7e640a5d392715fb7ea86b55d96bf87d2` VALUES (144, "一口食べる度に味が変わって\n魔法みたいなの！\nもしかして全部食べたら\nミヤコも魔法少女になれるの？", 5, "サイカワサイツヨな\n魔法のプリンなの\n中身をカラフルにするの～\n甘いプリンは頭が冴えるの！", 45, 1, 3, "きゅぴーん！キタコレ！なの！", "ナナカのプリン");
INSERT INTO `v1_0e73c6548040b134fd6a8d53f7a16ce7e640a5d392715fb7ea86b55d96bf87d2` VALUES (145, "一口食べたら謎の組織に\n狙われたり、前世の記憶が蘇る\n気がするの～設定盛りすぎなの\nミヤコは、ミヤコは…", 5, "小難しい言葉をささやきながら\n作ったら魔力あふれるプリンが\n爆誕したの！でも、不思議と\nイタイタしいのはなぜなの～？", 46, 1, 3, "人呼んで、疾風のミヤコなの！", "アンナのプリン");
INSERT INTO `v1_0e73c6548040b134fd6a8d53f7a16ce7e640a5d392715fb7ea86b55d96bf87d2` VALUES (146, "なんか普通のプリンよりも\nいい匂いがするの～…\nプリンのことがもっともっと\n好きになっちゃうの…", 5, "甘酸っぱい赤い木の実を\n切り刻んで入れるの\n甘くてちょっぴり刺激的な\nヤンデレのプリンなの", 47, 1, 3, "クスクス…クスクスクス…なの", "エリコのプリン");
INSERT INTO `v1_0e73c6548040b134fd6a8d53f7a16ce7e640a5d392715fb7ea86b55d96bf87d2` VALUES (147, "鼻に抜ける薬のにおいがアレ\nだけど大人っぽくて頭が\nよくなった気がするの。無性に\n実験したくてしかたないの", 5, "健康に気を遣うミヤコは\nプリンにお薬を入れてみたの～\nでもなんだか毒々しいから\n彩りにバラを添えてみたの～", 48, 1, 3, "どんなプリンも\nミヤコの隻眼からは\n逃れられないの～！", "ミツキのプリン");
INSERT INTO `v1_0e73c6548040b134fd6a8d53f7a16ce7e640a5d392715fb7ea86b55d96bf87d2` VALUES (148, "ん～王道なプリンは\n甘くて安定したおいしさなの～\n思わず笑顔になっちゃうの\nにこにこなの～♪…はっ！", 5, "小さいけどしっかりした\n軍人のプリンなの\nちょっと固めにして\n砂糖はいっぱい入れるの", 49, 1, 3, "私は子どもではない！なの！", "モニカのプリン");
INSERT INTO `v1_0e73c6548040b134fd6a8d53f7a16ce7e640a5d392715fb7ea86b55d96bf87d2` VALUES (149, "このプリンを食べてから\n誰かにお仕えしなきゃ\nいけない気がするデースなの\nそれはショ、ショー…", 5, "オーエド町で手に入れた素材と\nトーゴクに伝わる術をかけて\nプリンを作るの。シュババ！\n忍法隠し味の術なの！", 50, 1, 3, "ショーグン！　ミヤコと一緒に\n天下統一するデースなの！", "ニノンのプリン");
INSERT INTO `v1_0e73c6548040b134fd6a8d53f7a16ce7e640a5d392715fb7ea86b55d96bf87d2` VALUES (150, "カチカチに固めたせいで食感が\nプリンのようで\nプリンじゃないの…でもこの\nもどかしさが癖になるの…", 5, "オマエが持ってきた手錠を\nヒントに作ったプリンなの\nプリンが動けないように\nカチカチに固めたの", 51, 0, 3, "…ぐふふ、じゅるり～なの", "クウカのプリン");
INSERT INTO `v1_0e73c6548040b134fd6a8d53f7a16ce7e640a5d392715fb7ea86b55d96bf87d2` VALUES (151, "味も美しい以外の感想が\n出てこないの。ていうかこれを\n食べたミヤコも美しいの！\n鏡、鏡はどこなの！", 5, "とっても美しいプリンなの\n美しいものを手当たり次第\n入れたらすごいことになったの", 52, 1, 3, "あぁ、ミヤコはなんて美しいの～", "ユキのプリン");
INSERT INTO `v1_0e73c6548040b134fd6a8d53f7a16ce7e640a5d392715fb7ea86b55d96bf87d2` VALUES (152, "うん、やっぱりおいしく…\nん？あそこにいるのは\nアイツなの。あれ？\n体が勝手にアイツの方に…", 5, "知らないうちにお菓子が売れた\n時に思いついたプリンなの。\n作り方もよく覚えてない…\nけど、きっとおいしいの！", 53, 0, 3, "ジー…ってミヤコなにしてるの\nミヤコはストーカーじゃないの！", "アユミのプリン");
INSERT INTO `v1_0e73c6548040b134fd6a8d53f7a16ce7e640a5d392715fb7ea86b55d96bf87d2` VALUES (153, "見た目通り甘々で優しい味なの\nでも、レシピを見たら裏面に\n別の作り方が書いてあるの。\nこれだと激辛プリンに…", 5, "イタズラ好きの手下と一緒に\n作ったプリンなの。見た目は\nかわいいけど、作り方は\n意外と複雑なの～", 54, 0, 3, "にひひ…イタズラの時間なの！", "ミソギのプリン");
INSERT INTO `v1_0e73c6548040b134fd6a8d53f7a16ce7e640a5d392715fb7ea86b55d96bf87d2` VALUES (154, "ん～、ふわふわの甘々なの！\nなんだか楽しくなって\n心も体もるんたったしてくるの", 5, "素直でやさしい手下と一緒に\n動物のぬいぐるみをいっぱい\n並べて作ったの", 55, 0, 3, "ぴょんぴょこぴょーん、なの♪", "ミミのプリン");
INSERT INTO `v1_0e73c6548040b134fd6a8d53f7a16ce7e640a5d392715fb7ea86b55d96bf87d2` VALUES (155, "ひんやりしてて暑い日でも\nおいしく食べられそうなの！\nん？これを買いたい大人が\nいる？それって…", 5, "幽霊を怖がっている手下と\n一緒に作ったプリンなの。\n小さいクセにきっちりしてて\nとってもかわいいプリンなの", 56, 0, 3, "へんたいふしんしゃさんなの！", "キョウカのプリン");
INSERT INTO `v1_0e73c6548040b134fd6a8d53f7a16ce7e640a5d392715fb7ea86b55d96bf87d2` VALUES (156, "見て食べて楽しめる新機軸の\nプリンなの。ミヤコは幽霊\nだけど自分の足でランウェイを\n歩きたくなってきたの！", 5, "カリスマモデルなプリンなの\nモリモリにデコレーションして\nカリスマ感を演出したの", 57, 1, 3, "ハート狙い撃ち！なの！", "スズナのプリン");
INSERT INTO `v1_0e73c6548040b134fd6a8d53f7a16ce7e640a5d392715fb7ea86b55d96bf87d2` VALUES (157, "プ、プリンは全部ミヤコのもの\nなのに、なんだかこのプリンは\nいろんな人に教えたく\nなっちゃう不思議な味なの！", 5, "学校の先生をしてるヤツの\nプリンなの。お堅くしようと\nしたら、いつの間にか色っぽく\nなっちゃったの。なんでなの？", 58, 0, 3, "授業を始めます♪なの！", "イオのプリン");
INSERT INTO `v1_0e73c6548040b134fd6a8d53f7a16ce7e640a5d392715fb7ea86b55d96bf87d2` VALUES (158, "ミヤコはプリンならどんなもの\nでも食べるの。でもカラメルを\nちょっとだけ足すの。\nちょっとだけなら…", 5, "少し背伸びしたおませな子を\n表現したプリンなの。あえて\n甘さ控えめなの。カラメルは\n後乗せできるから安心するの", 59, 1, 3, "立派なレディ、なの！", "ミサキのプリン");
INSERT INTO `v1_0e73c6548040b134fd6a8d53f7a16ce7e640a5d392715fb7ea86b55d96bf87d2` VALUES (159, "味はすごいゴージャスなの！\nボスの風格があるの！\nビッグなミヤコに\nプリンを捧げるの！", 5, "謎に包まれたプリンができたの\n何か隠してるようなの…\nこれは危険なプリンなの！", 60, 1, 3, "プリンを持ってこないと\nお仕置きだよ～☆なの！", "ホマレのプリン");
INSERT INTO `v1_0e73c6548040b134fd6a8d53f7a16ce7e640a5d392715fb7ea86b55d96bf87d2` VALUES (160, "最初の一口目が\nすごいインパクトなの！\n無性にケンカしたくなるの！\nプリンをよこせなの！", 5, "ワイルドな見た目なの！\nこれは期待できそうなの。\nきっと躍動感あふれる味なの！", 61, 1, 3, "たぎってきたの！", "カヤのプリン");
INSERT INTO `v1_0e73c6548040b134fd6a8d53f7a16ce7e640a5d392715fb7ea86b55d96bf87d2` VALUES (161, "見た目はアレだけど味はおいし\nいの…あと主張もはっきりして\nるの！やる気と自信だけは\n出てきたのうおおおーなの！", 5, "なんか見た目がパッとしないの\nこれほんとに大丈夫なの？\nなんか頼りないの…", 62, 0, 3, "下剋上、やってやるですなの！", "イノリのプリン");
INSERT INTO `v1_0e73c6548040b134fd6a8d53f7a16ce7e640a5d392715fb7ea86b55d96bf87d2` VALUES (162, "むむむ…食べたら\nやる気が湧いてきたの！\nミヤコを邪魔するやつはみんな\nまとめてぶっ飛ばしてやるの～", 5, "天下の大悪党のプリンなの\nこれまでのジョーシキに\n捉われないプリンを\n作ってみたの～", 63, 1, 3, "どけどけ～！なの～！", "ムイミのプリン");
INSERT INTO `v1_0e73c6548040b134fd6a8d53f7a16ce7e640a5d392715fb7ea86b55d96bf87d2` VALUES (163, "いつのまにか作ったの全部\n食べちゃったの。なんで\nプリンは分身しないの？\n無限に増えろなの！", 5, "いろんなものに変身したり\n分身したりできるヤツの\nプリンなの。型で同じプリンを\nたくさんたくさん作ったの", 64, 1, 3, "ミラーミラー！なの！", "ネネカのプリン");
INSERT INTO `v1_0e73c6548040b134fd6a8d53f7a16ce7e640a5d392715fb7ea86b55d96bf87d2` VALUES (164, "むぅ…認めたくないけど\nおいしいの…これを何個も\n作れるほどのお金を稼ぐのは\n大変なの…でもおいしいから…", 5, "金の亡者のプリンなの\n金にものを言わせて作って\nみたの。おばあちゃんの\nプリンと対極なの", 65, 1, 3, "プリンに忠誠を誓いますわ！\nなの！", "クレジッタのプリン");
INSERT INTO `v1_0e73c6548040b134fd6a8d53f7a16ce7e640a5d392715fb7ea86b55d96bf87d2` VALUES (165, "手堅い…！手堅いの…！\n隙のないプリンなの！\n今のミヤコなら完璧な\n書類作成ができそうなの！", 5, "みんなお世話になるギルド\n管理協会職員のプリンなの\nお役所感を出すために手堅く\n王道に作ったの", 66, 1, 3, "ギルド管理協会へようこそ！\nなの！", "カリンのプリン");
